function Model(){var n=this;n.copyAddress=function(n){if(window.clipboardData&&window.clipboardData.setData)return clipboardData.setData("Text",n);if(document.queryCommandSupported&&document.queryCommandSupported("copy")){var t=document.createElement("textarea");t.textContent=n;t.style.position="fixed";document.body.appendChild(t);t.select();try{return document.execCommand("copy")}catch(i){return console.warn("Copy to clipboard failed.",i),!1}finally{document.body.removeChild(t)}}}}var model=new Model;ko.applyBindings(model);